  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>To-Do List</h1>
      </header>
      <Input />
      <div className="Box">
        <Taks task="Test by default" />
      </div>
    </div>
  );
}

export default App;
